import React from 'react';
import styled from 'styled-components';
// import { toFixedToTwo } from '../../helper/formatter';

const AnalysisTable = ({ tableData }) => {
  console.log(tableData, 'AnalysisTable');
  return (
    <Styles>
      <table style={{ width: '137%' }}>
        <tbody>
          {tableData.length && tableData.length > 0 ? (
            tableData.map((droplet, index) => {
              return (
                <tr key={index}>
                  <td className="cellAlign" style={{ backgroundColor: '#e8eef2' }}>
                    {droplet.style_id}
                  </td>
                  {console.log(droplet.style_desc | toFixedToTwo, 'anu')}
                  <td className="cellData">{droplet.style_desc | toFixed(2)}</td>
                </tr>
              );
            })
          ) : (
            <tr>
              <td colSpan="5">Loading...</td>
            </tr>
          )}
        </tbody>
      </table>
    </Styles>
  );
};

export default AnalysisTable;

const Styles = styled.table`
  font-family: arial, sans-serif;
  border-collapse: collapse;
  width: 100%;

  td,
  th {
    border: 1px solid #dddddd;
    text-align: center;
    padding: 8px;
  }
  tr {
    font-size: 15px;
    line-height: 4rem;
    font-size: 15px;
    color: #3c4148;
    font-weight: 500;
    // background-color: #e8eef2;
  }
`;
